import React from 'react';
import './App.css';
const axios = require('axios');



function App() {
    axios.get("https://api.spacexdata.com/v3/capsules").then(function (response) {
      console.log(response);
    })
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit oh boi<code>src/App.js</code> and save to reload.

        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>


    </div>
  );
}

export default App;
